import React from 'react';

const AddressSearchBar = (props) => {
    return (
        <div>
            <form onSubmit={(e) => {
                e.preventDefault();
                props.callback(e.target);
            }
            }>
                <input
                    type="text" className="addressSelector" name="address" placeholder="Markens gate 4a, 4610 Kristiansand"/>
            </form>
        </div>
    )
}

export default AddressSearchBar;
